import React from 'react';
import s from './Header.module.css';




export const Header = () => {
  return (
    <header className={s.header}>
      <img src='https://cdn.dribbble.com/users/1265223/screenshots/5321233/samurai.png'></img>
      <div className={s.loginBlock}></div>

    </header>
  );
}
